import React from 'react';

const Todo = ({ text, id }) => {
    return(
        <div className="todo">

            <span>
                <span><li className="todo-item">{text} </li></span>
                <span className="todo-buttons">
                    <button className="complete-btn">
                        <i className="fas fa-check"></i>
                    </button>
                    <button className="trash-btn">
                        <i className="fas fa-trash"></i>
                    </button>
                </span>
            </span>

        </div>
    );
}

export default Todo;
